import React from 'react';
import { makeStyles } from '@material-ui/core/styles';



const useStyles = makeStyles(theme => ({
	root: {
		display: 'flex',
		flexDirection: 'column',
		flexWrap: 'nowrap',

	},
	baseitem: {
		backgroundColor: 'red',
		marginTop: '20px',
		textAlign: 'center',
		width: '50%',
	}
}));

export default function Base() {
	const classes = useStyles();

	return (
		<div className={classes.root}>
			<div className={classes.baseitem}> A </div>
			<div className={classes.baseitem}> B </div>
			<div className={classes.baseitem}> C </div>
			<div className={classes.baseitem}> D </div>
		</div>
	);
}
